import classes from './NavigationBar.module.css';

const iconPath = require('../../assets/logo.png');
function NavigationBar() {
  return (
    <header>
        <nav className={classes.navbar}>
            <div className={classes.navbar__right}>
                <img src={iconPath} alt="Logo"/>
            </div>
            <div className={classes.navbar__left}>
                <a href="#about" className={classes.link}>About</a>
                <a href="#experience" className={classes.link}>Experience</a>
                <a href="#prof" className={classes.link}>Proficiencies</a>
                <a href="#contact" className={classes.btn}>Contact</a>
            </div>
        </nav>
    </header>
  );
}

export default NavigationBar;
